import {useEffect, useState} from "react";
import MenuServices from "../../../../services/menuServices/MenuServices";
import Toast from "../../../../components/toast-message/ToastMessage";
import Table from "../../../../components/custom-table/CustomTable";
import {useParams} from "react-router";
import InventoryHistoryService from "../../../../services/warehouseServices/InventoryHistoryService";

export default function InventoryHistoryDetail() {
    const {id} = useParams();
    const [inventoryHistoryInfo, setInventoryHistoryInfo] = useState({});
    const [inventoryHistoryDetailList, setinventoryHistoryDetailList] = useState([]);
    const [pagination, setPagination] = useState({
        page: 0,
        size: 10
    })

    const getMenuInfo = async (id) => {
        try {
            const response = await InventoryHistoryService.getDetail(id);
            if (response.success) {
                setInventoryHistoryInfo(response.data)
                setinventoryHistoryDetailList(response.data.inventoryHistoryDetailList);
            } else {
                Toast.error(response.message);
            }
        } catch (error) {
            Toast.error(error);
        }
    };

    const paginate = (page) => {
        setPagination({
            page: page,
            size: 10
        })
    }

    useEffect(() => {
        getMenuInfo(id)
    }, [pagination])

    useEffect(() => {

    }, [inventoryHistoryDetailList])


    return (
        <>
            <div className="card-header">
                Inventory history detail
            </div>
            <div>
                <div>Name: {inventoryHistoryInfo.name}</div>
                <div>Description: {inventoryHistoryInfo.description}</div>
                <div>Reported Date: {inventoryHistoryInfo.reportedDate}</div>
            </div>
            <div className="card-body">
                {inventoryHistoryDetailList && (
                    <Table data={inventoryHistoryDetailList} endpoint={"cms/warehouse/materials"}/>)}
            </div>
        </>
    );
}
